import './Card.css';

import { Link } from 'react-router-dom';

const Card = ({ id, nombre, imagen, types, vida, ataque, defensa, velocidad, altura, peso }) => {

    {
        id.length > 30 ? types = types.map(typ => typ.name) : types = types.map(tip => tip);

        return (
            <Link>
                <div className="carta">

                    <b className='titleCart'> {nombre} </b>
                    <img className='imgCart' src={imagen} alt="" />
                    <p> tipo: {types} </p>


                </div>
            </Link>
        )
    }
}

export default Card;
